INSERT INTO `ic_app_pages` VALUES (1,'About Youth in Politics','à¤¯à¥à¤¥ à¤à¤¨ à¤ªà¥à¤²à¤¿à¤à¤¿à¤à¥à¤¸ à¤à¥ à¤¬à¤¾à¤°à¥ à¤®à¥à¤','<p>Youth in Politics (YIP) is a first-of-its-kind pan-India platform for youth between 18 &amp; 35 years of age, to join active politics under the mentorship of Prashant Kishor &amp; I-PAC. Set up with a vision to transform the political landscape into one where youth find a proportionate voice, YIP supports and mentors young leaders as they take the plunge into active electoral politics. Whether you are a professional looking to start from your workplace, a college student stepping into student politics or a youth in a village aspiring to become a Sarpanch, YIP offers an opportunity for you to- -Leverage the political acumen of Prashant Kishor -Receive professional guidance from I-PAC -Receive tailor-made mentorship plans -Connect with like-minded aspirants across India</p>\r\n','<p>à¤¯à¥à¤¥ à¤à¤¨ à¤ªà¥à¤²à¤¿à¤à¤¿à¤à¥à¤¸ à¤à¤ à¤à¤¸à¤¾ à¤à¤¨à¥à¤à¤¾ à¤¦à¥à¤¶à¤µà¥à¤¯à¤¾à¤ªà¥ à¤®à¤à¤ à¤¹à¥, à¤à¥ 18 à¤¸à¥ 35 à¤µà¤°à¥à¤· à¤à¥ à¤¯à¥à¤µà¤¾à¤à¤ à¤à¥ à¤ªà¥à¤°à¤¶à¤¾à¤à¤¤ à¤à¤¿à¤¶à¥à¤° à¤à¤° I-PAC à¤à¥ à¤®à¤¾à¤°à¥à¤à¤¦à¤°à¥à¤¶à¤¨ à¤®à¥à¤ à¤¸à¤à¥à¤°à¤¿à¤¯ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿ à¤®à¥à¤ à¤à¤¨à¥ à¤à¤¾ à¤®à¥à¤à¤¾ à¤¦à¥à¤¤à¤¾ à¤¹à¥à¥¤ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿à¤ à¤ªà¤°à¤¿à¤¦à¥à¤¶à¥à¤¯ à¤à¥ à¤¬à¤¦à¤²à¤¨à¥ à¤à¤° à¤¯à¥à¤µà¤¾à¤à¤ à¤à¥ à¤¸à¤à¥à¤°à¤¿à¤¯ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿ à¤®à¥à¤ à¤à¤¨à¥à¤ªà¤¾à¤¤à¤¿à¤ à¤¸à¤¹à¤­à¤¾à¤à¤¿à¤¤à¤¾ à¤¸à¥à¤¨à¤¿à¤¶à¥à¤à¤¿à¤¤ à¤à¤°à¤¨à¥ à¤à¥ à¤¦à¥à¤·à¥à¤à¤¿à¤à¥à¤£ à¤¸à¥ à¤à¤¸à¤à¥ à¤¶à¥à¤°à¥à¤à¤¤ à¤à¥ à¤à¤¯à¥ à¤¹à¥à¥¤ YIP à¤à¤¨ à¤¯à¥à¤µà¤¾à¤à¤ à¤à¤¾ à¤¸à¥à¤µà¤¾à¤à¤¤ à¤à¤µà¤ à¤®à¤¾à¤°à¥à¤à¤¦à¤°à¥à¤¶à¤¨ à¤à¤°à¤¤à¤¾ à¤¹à¥, à¤à¥ à¤¸à¤à¥à¤°à¤¿à¤¯ à¤à¥à¤¨à¤¾à¤µà¥ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿ à¤®à¥à¤ à¤à¤¨à¤¾ à¤à¤¾à¤¹à¤¤à¥ à¤¹à¥à¤à¥¤ - à¤ªà¥à¤°à¤¶à¤¾à¤à¤¤ à¤à¤¿à¤¶à¥à¤° à¤à¥ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿à¤ à¤à¥à¤¶à¤² à¤à¤¾ à¤²à¤¾à¤­ à¤à¤ à¤¾à¤à¤ - I-PAC à¤¸à¥ à¤ªà¥à¤°à¥à¤«à¥à¤¶à¤¨à¤² à¤®à¤¾à¤°à¥à¤à¤¦à¤°à¥à¤¶à¤¨ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤à¤°à¥à¤ - à¤¸à¥à¤µà¤¯à¤ à¤à¥ à¤²à¤¿à¤ à¤®à¤¾à¤°à¥à¤à¤¦à¤°à¥à¤¶à¤¨ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤à¤°à¥à¤ - à¤¦à¥à¤¶à¤­à¤° à¤à¥ à¤¸à¤®à¤¾à¤¨ à¤µà¤¿à¤à¤¾à¤°à¤§à¤¾à¤°à¤¾ à¤µà¤¾à¤²à¥ à¤²à¥à¤à¥à¤ à¤¸à¥ à¤à¥à¤¡à¤¼à¥</p>\r\n','pages/pages_1568885054YouthinPolitcs-Finallogo-01.png','','about-yip','2019-02-11 03:00:00','2019-09-19 15:05:50'),(2,'About I-PAC','I-PAC à¤à¥ à¤¬à¤¾à¤°à¥ à¤®à¥à¤','Indian Political Action Committee (I-PAC) is the platform of choice for students and young professionals to participate in and make a meaningful contribution to political affairs and governance of the country, without necessarily being part of a political party.\r\n\r\nSince 2013, I-PAC has brought some of the best minds from diverse academic and professional backgrounds together. I-PAC works with visionary leaders, helps them set a citizen-centric agenda and partners with them to conceptualize & implement effective methods of taking it to the masses.','à¤à¤à¤¡à¤¿à¤¯à¤¨ à¤ªà¥à¤²à¤¿à¤à¤¿à¤à¤² à¤à¤à¥à¤¶à¤¨ à¤à¤®à¤¿à¤à¥ (I-PAC) à¤à¤¨ à¤¯à¥à¤µà¤¾ à¤ªà¥à¤°à¥à¤«à¥à¤¶à¤¨à¤²à¥à¤¸ à¤à¥ à¤²à¤¿à¤ à¤à¤ à¤ªà¥à¤²à¥à¤à¤«à¥à¤°à¥à¤® à¤¹à¥, à¤à¥ à¤à¤¿à¤¸à¥ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿à¤ à¤ªà¤¾à¤°à¥à¤à¥ à¤à¥ à¤¸à¤¾à¤¥ à¤à¥à¤¡à¤¼à¥ à¤¬à¤¿à¤¨à¤¾ à¤¦à¥à¤¶ à¤à¥ à¤°à¤¾à¤à¤¨à¥à¤¤à¤¿ à¤à¤µà¤ à¤ªà¥à¤°à¤¶à¤¾à¤¸à¤¨ à¤®à¥à¤ à¤à¤°à¥à¤¥à¤ªà¥à¤°à¥à¤£ à¤¯à¥à¤à¤¦à¤¾à¤¨ à¤¦à¥à¤¨à¤¾ à¤à¤¾à¤¹à¤¤à¥ à¤¹à¥à¥¤\r\n\r\n2013 à¤¸à¥, I-PAC à¤¨à¥ à¤µà¤¿à¤µà¤¿à¤§ à¤¶à¥à¤à¥à¤·à¤£à¤¿à¤ à¤à¤µà¤ à¤ªà¥à¤¶à¥à¤µà¤° à¤ªà¥à¤·à¥à¤ à¤­à¥à¤®à¤¿ à¤¸à¥ à¤à¥à¤¡à¤¼à¥ à¤®à¥à¤§à¤¾à¤µà¥ à¤¯à¥à¤µà¤¾à¤à¤ à¤à¥ à¤à¤ à¤¸à¤¾à¤¥ à¤²à¤¾à¤à¤°, à¤à¤¨à¥à¤¹à¥à¤ à¤à¥à¤¨à¤¾à¤µà¥ à¤ªà¥à¤°à¤à¥à¤°à¤¿à¤¯à¤¾ à¤à¤¾ à¤¹à¤¿à¤¸à¥à¤¸à¤¾ à¤¬à¤¨à¤¨à¥ à¤à¤ à¤à¤¨à¥à¤ à¤¾ à¤à¤µà¤¸à¤° à¤ªà¥à¤°à¤¦à¤¾à¤¨ à¤à¤¿à¤¯à¤¾ à¤¹à¥à¥¤ IPAC à¤à¤