f early career professionals by creating a unique opportunity to work across a broad range of assignments, helping to forge and execute dynamic political campaigns on the ground.</strong></p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"3\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>Agreement:</strong></p>\r\n\r\n	<ol>\r\n		<li dir=\"ltr\">\r\n		<p dir=\"ltr\"><strong>You shall associate yourself with the Company only if you have read and understood the Terms and Conditions and agree to abide by the same. If you have any question about the Terms and Conditions, you can contact the Company.</strong></p>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"4\">\r\n	<li dir=\"ltr\">\r\n	<p dir=\"ltr\"><strong>Definitions:</strong></p>\r\n	</li>\r\n</ol>\r\n\r\n<p dir=\"ltr\"><strong>In these Terms and Conditions (unless the context otherwise requires), capitalized terms shall bear the meanings attributed to them below:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"5\">\r\n	<li>\r\n	<ol>\r\n		<li dir=\"ltr\">\r\n		<p dir=\"ltr\"><strong>&nbsp;&ldquo;Applicable Law&rdquo; shall mean any treaties, statutes, enactments, act of legislature, regulation, ordinance, rule, judgment, order, decree, by-law, approval from the concerned authority, government resolution, order, directive, guideline, policy, requirement, or other governmental restriction or any similar form of decision of, or determination by, or any interpretation or adjudication having the force of law of any of the foregoing, by any concerned, including any amendments issued from time to time;</strong></p>\r\n		</li>\r\n		<li dir=\"ltr\">\r\n		<p dir=\"ltr\"><strong>&ldquo;Approvals&rdquo; shall mean all approvals, licenses, registrations, permits or authorizations which are necessary for carrying out the obligations contemplated under these Terms and Conditions;</strong></p>\r\n		</li>\r\n		<li dir=\"ltr\">\r\n		<p dir=\"ltr\"><strong>&ldq