INSERT INTO `ic_event` VALUES (2,'YIP at Nalsar','YIP at Nalsar','<p>Mr Prashant Kishor is the National Vice-President of Janata Dal (United). After spending a decade in the United Nations as a Public Health professional, he moved back to India to mentor the political consultancy groups CAG and I-PAC. He was one of the leading strategists of BJP&#39;s 2014 election campaign and since then, has helped many top leaders including Nitish Kumar and Captain Amarinder Singh in attaining top public offices.<br />\r\n<br />\r\nThe Youth in Politics is an initiative by Prashant and IPAC with an objective to provide a pan-India platform for youth between 18 &amp; 35 years of age to join active electoral politics. In this talk, Prashant will talk about the need for youth to enter active politics and how deserving young candidates can be mentored in getting elected to public offices. He will also be taking questions on Elections in India including the upcoming 2019 General Elections.</p>\r\n','<p>Mr Prashant Kishor is the National Vice-President of Janata Dal (United). After spending a decade in the United Nations as a Public Health professional, he moved back to India to mentor the political consultancy groups CAG and I-PAC. He was one of the leading strategists of BJP&#39;s 2014 election campaign and since then, has helped many top leaders including Nitish Kumar and Captain Amarinder Singh in attaining top public offices.<br />\r\n<br />\r\nThe Youth in Politics is an initiative by Prashant and IPAC with an objective to provide a pan-India platform for youth between 18 &amp; 35 years of age to join active electoral politics. In this talk, Prashant will talk about the need for youth to enter active politics and how deserving young candidates can be mentored in getting elected to public offices. He will also be taking questions on Elections in India including the upcoming 2019 General Elections.</p>\r\n','Mr Prashant Kishor',1,'event/ic_1555664026pk.jpg','2019-04-27','Nalsar, Himachal Pradesh, India','31.5862189','76.95710459999998','Himachal Pradesh',0,0,'active','2019-04-19 08:53:46','2019-05-07 08:34:55'),(3,'In Conversation with Saurabh Dwivedi','In Conversation with Saurabh Dwivedi','<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n','<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n','Test Name',1,'event/ic_1555664177download.jpeg','2019-05-09','Patna, Bihar, India','25.5940947','85.13756450000005','Bihar',0,0,'active','2019-04-19 08:56:17','2019-04-23 11:01:17');
