'unapproved','2019-05-10 09:14:10',NULL),(67,'test',NULL,'Testing',NULL,170,'false',NULL,NULL,NULL,NULL,NULL,'unapproved','2019-08-13 16:41:23',NULL),(68,'test',NULL,'Testing the feature',NULL,170,'false',NULL,NULL,NULL,NULL,NULL,'unapproved','2019-08-14 12:32:32',NULL),(69,'hi',NULL,'Test',NULL,180,'false',NULL,NULL,NULL,NULL,NULL,'approved','2019-08-14 22:18:42','2019-08-16 11:14:26'),(70,'21 Election Slogans That Decided The Fate Of Indian Politics','21 Election Slogans That Decided The Fate Of Indian Politics','<p><br />\r\n&nbsp;</p>\r\n1. Jan Sangh ko vote do, bidi peena chhod do;\r\nBidi mein tambaku hai, Congress-wala daaku hai\r\nBhartiya Jan Sangh, in the elections of 1967, asked the voters to reject both Congress and tobacco with this slogan. \r\n\r\n2. Progress through Congress\r\nCongress represented itself as the face of development and launched Progress through Congress campaign in the 1960s.\r\n\r\n3. Congress or Progress?\r\n Shiv Sena, however, questioned the Congress party\'s campaign like this.\r\n\r\n4. Jai Jawan, Jai Kisan \r\nThis was the slogan given by former Indian Prime Minister Lal Bahadur Shashtri, in 1965, hailing the soldiers and the farmers of the country.\r\n \r\n5. Vote for calf and cow, forget all others now\r\nThe actual symbol of Congress party was the yoked oxen, but when Indira Gandhi and Congress split, she created her own faction and this new party symbol as an offshoot of the original, during the 1960s. It\'s said that people started making fun that the cow and calf is Indira Gandhi and Sanjay Gandhi, after which it was changed. \r\n\r\n6. Yeh dekho Indira ka khel, kha gayi shakkar, pee gayi tel\r\nJan Sangh\'s election campaign highlighted the inflation during Congress government, with this funny slogan.\r\n\r\n7. Garibi hatao, Indira lao, Desh bachao \r\nThe anti-poverty theme took the centre-stage in Indira Gandhi government\'s election campaign in 1971. \r\n\r\n8. Indira hatao, Desh bachao \r\nJayaprakash Narayan\'s Janata Party played spoiler for Indira Gandhi\'s campaign, with this slogan. \r\n\r\n9. Ek Sherni, Sau Langur, Chikmaglur bhai Chikmaglur\r\nThis political one-liner, mocking the opposition, was created by Congressman poet Srikant Verma for Indira Gandhi\'s by-election in 1978 from Chikkmagluru district. \r\n\r\n10. Jab tak sooraj chand rahega, Indira tera naam rahega\r\nAfter Indira Gandhi was assassinated, this election slogan was coined by the Congress for 1984 elections. And the sympathy it generated led to a landslide victory of the party.  \r\n\r\n11. Jab tak rahega samose mein aloo, tab tak rahega Bihar mein Lalu\r\nThis is one of the most entertaining election campaigns projecting Lalu Prasad Yadav as the original leader of Bihar. \r\n\r\n12. Bachcha bachcha Ram ka, Janmabhoomi ke kaam ka\r\nThere have been election campaigns dividing country on communal lines. Sending the message of Hindutva, Vishwa Hindu Parishad (VHP) gave out this slogan.\r\n\r\n13. Mile Mulayam-Kanshiram, hawa ho gaye Jai Shree Ram\r\nThis slogan was given after the disputed structure at Ayodhya was demolished, and Mulayam Singh Yadav and Kanshiram united to form a government.  \r\n\r\n14. Jaat par na pat par, mohar lagegi haath par\r\nWith this slogan by former Prime Minister P V Narsimha Rao, Congress gave a message that its political strategy is not guided by caste, during the 1996 elections.\r\n\r\n15. Bari bari sab ki bari, ab ki bari Atal Bihari\r\nThis was BJPâs slogan at Lucknow election rally, in March 1996. BJP come to power for the first time for a 13-day rule.\r\n\r\n16. Jancha, Parkha, Khara\r\nBJP led a campaign against Congress in 1999, with Atal Bihari Vajpayee as its Prime Ministerial candidate, and used his corruption-free image to attract voters. \r\n\r\n17. Sonia nahi yeh aandhi hai, doosri Indira Gandhi hai\r\nThis slogan coined by Congress attempted to popularize Sonia Gandhi by projecting her as the second Indira Gandhi, in 2009.\r\n\r\n18. UP mein hai dum, kyunki jurm hai yahan kam\r\nAmitabh Bachchan gave a clean chit to Samajwadi Party by suggesting that crime rate was low in the Uttar Pradesh, during 2007 elections. He was served a notice by the Uttar Pradesh Information Commission seeking explanation for this. \r\n\r\n19. UP mein tha dam, lekin kahan pahuch gaye hum\r\nCongress targeted Samajwadi Party and replied to Amitabh Bachchan\'s advertisement with this slogan.\r\n\r\n20. Poori roti khayenge, 100 din kaam karenge, dawai lenge aur Congress ko jitayenge\r\nRahul Gandhi addressed a tribal rally in Udaipur and gave this new poll slogan.\r\n\r\n21. Abki bar Modi sarkar\r\nPromosing achche din, this was one of the most popular election phrases that spread like wild fire, and Narendra Modi was elected as the Prime Minister of India in 2014.\r\n','',1,'true',0,0,0,'','3 Min Read','approved','2019-08-16 14:19:20',NULL),(71,'The grassroots \'guerilla army\' powering Macron\'s French election battle','The grassroots \'guerilla army\' powering Macron\'s French election battle','Alain Garcia, an office worker in an energy company, unlocked his grey hatchback parked on a quiet street. âWelcome to the Macron-mobile,â he said.\r\n\r\nThousands of smiling election pictures of the centrist French presidential favourite beamed out from the backseat. At one point Garcia had 11,000 copies of Emmanuel Macronâs manifesto leaflets crammed into his family car which he uses for his daily commute. âI do sometimes worry a bit about the carâs suspension,â he said, slowing to go over a speedbump in Villeurbanne, a town whose diverse ethnic mix of housing estates and gentrification nudges up against the south-eastern city of Lyon.\r\n\r\nWhile conventional political parties have local offices across France, Macronâs maverick, independent bid for president without a party means his campaign is largely being run from private apartments, family cars and gatherings around bistro tables by thousands of enthusiastic, unpaid volunteers, many of whom have never previously been involved in politics.\r\n\r\nNo one has ever attempted to win a modern French presidential election without a political party structure behind them. Macron, a 39-year-old former investment banker who briefly served as economy minister under the Socialist president FranÃ§ois Hollande, has never run for any kind of election before. He claims his âneither left nor rightâ campaign is a ârevolutionâ to do away with the old political system and its parties.\r\n\r\n\r\nBut in the final few weeks before the 23 April first-round presidential vote, pressure is mounting on Macronâs grassroots volunteers. First they must consolidate a volatile and undecided potential electorate. Although polls show Macron in the lead, a significant number of his potential voters tend to be more wavering than other candidatesâ solid base, including the far-right Front Nationalâs Marine Le Pen. Crucially, Macron must prove his fledgling movement of supporters can morph into a major political operation capable of winning enough seats in the parliamentary elections in June to allow him to govern and deliver his manifesto promises.\r\n\r\nMacronâs movement, En Marche! (On the Move), was created less than a year ago, initially as a door-to-door operation in which volunteers asked the public what was wrong with France. Free to join online, it has more than 230,000 members. It is run more like a tech startup than a classic political party and uses sophisticated digital systems to crunch election data and pinpoint target voters. Without the financial pot of a standard political party, the movement is funded by donations â capped by law at â¬7,500 (Â£6,370) per person. Over â¬6.5m has been collected so far â the average donation is â¬250 or less. Macron has also taken out a personal loan of about â¬8m.\r\n\r\nFrom the En Marche! headquarters in Paris, where young volunteers known by the English word âhelpersâ work on laptops, the final campaign push has been set out. Members â ranging from students and the unemployed to retired teachers and business leaders â still meet in committees across France to debate policy. But their focus is now on reaching a maximum of undecided voters in the next few weeks. They have been advised to use every conversation â in the bakery, on trains, with colleagues â and even host dinners at home. They should, as Macron does, always try to smile.\r\n\r\nâThereâs a freedom, thereâs no hierarchy, itâs about spurring on your team of volunteers, itâs so much more human and we feel like weâre building something together,â said Garcia, 49, who preferred canvassing with En Marche! to his time canvassing for the rightwing Nicolas Sarkozyâs first presidential campaign 10 years ago. Garcia had become disillusioned with politics, but now coordinates 700 Macron volunteers in Villeurbanne.\r\n\r\nâI joined because I donât want the same old people running politics. We need change, people from civil society,â said Sophie Solmini, 44, a former Socialist party canvasser who had taken time off from her housing association job to volunteer for Macron âseven days a week from 7am to 2amâ from her council flat.\r\n\r\nNearby, the city of Lyon has been described as the birthplace of âMacron maniaâ. Lyonâs mayor, GÃ©rard Collomb, was one of the first major Socialist party figures to jump ship to Macronâs camp and campaign for him. But Macron faces a delicate balancing act. Although key political figures have rallied to him from the left and right, he has to ensure his movement is not swamped by politicians. He wants to avoid accusations that he is recycling the old political class.\r\n\r\nâClassic political parties are solid, they have a structure, like the Prussian army,â said Bruno Bonnell, the tech entrepreneur and robot developer who coordinates En Marche! in Lyon. âWeâre much more guerilla style. Weâre fluid, weâre about fast action and a swift decision-making process. Weâre surprisingly organised for what is essentially a huge magma of emotion.â\r\n\r\nBonnell, 58, who calls himself a ârobot revolutionaryâ, has not worked on an election campaign before. He is symbolic of Macronâs promise to modernise and champion digital innovation. âEnough of cynicism and despair,â Bonnell said. âMacron embodies the new positive mindset to take France into the 21st century, because heâs young enough to understand what itâs all about.â Refuting criticism from political opponents that Macron is the candidate of the âhappily globalisedâ elites of major cities, Bonnell, who described his roots as âworking-class leftâ, had been out canvassing in small peripheral areas of the RhÃ´ne where Le Penâs far-right vote is growing. âWeâre living a digital revolution. There is no reason for that to scare us,â he told a rally of largely over-50s in Villeurbanne.\r\n\r\nMacronâs test is to convince voters that En Marche! can transform itself into a parliamentary force. All recent French presidential elections have been followed directly by parliamentary elections that delivered the winnerâs party a majority of MPs. Without that majority, the presidentâs hands would be tied. Macronâs opponents are attacking him by warning he could usher in an uncertain period of messy coalition. The Socialist candidate BenoÃ®t Hamon said Macron would mean an âungovernableâ France.\r\n\r\nMacron said French voters would âlogicallyâ have given him a parliamentary majority if he won the presidency. He wants to field En Marche! candidates in all 577 seats in the June legislative elections. He insists half his candidates will be women â in winnable seats â and half must be newcomers from civil society. The others, politicians, must run under a single Macron ticket, not for their previous parties.\r\n\r\nOn Lyonâs shopping streets, the high rate of undecided voters was clear. âIâm hesitating between [the rightwing] FranÃ§ois Fillon and Macron,â said Colette, 69, a retired accountant. âThe scandals around Fillon are putting me off, but itâs the manifesto that counts. Iâll end up writing out a list of pros and cons ...â\r\n\r\nEric, 41, worked in a department store and felt security was the most important election issue. He took a Macron leaflet from a volunteer but shrugged. âIâm fed up with the lot of them, I donât think any of them can be trusted. I do want to vote, but Iâll decide at the last minute.â','<p>Alain Garcia, an office worker in an energy company, unlocked his grey hatchback parked on a quiet street. &ldquo;Welcome to the Macron-mobile,&rdquo; he said.</p>\r\n\r\n<p>Thousands of smiling election pictures of the centrist French presidential favourite beamed out from the backseat. At one point Garcia had 11,000 copies of Emmanuel Macron&rsquo;s manifesto leaflets crammed into his family car which he uses for his daily commute. &ldquo;I do sometimes worry a bit about the car&rsquo;s suspension,&rdquo; he said, slowing to go over a speedbump in Villeurbanne, a town whose diverse ethnic mix of housing estates and gentrification nudges up against the south-eastern city of Lyon.</p>\r\n\r\n<p>While conventional political parties have local offices across France, Macron&rsquo;s maverick, independent bid for president without a party means his campaign is largely being run from private apartments, family cars and gatherings around bistro tables by thousands of enthusiastic, unpaid volunteers, many of whom have never previously been involved in politics.</p>\r\n\r\n<p>No one has ever attempted to win a modern French presidential election without a political party structure behind them. Macron, a 39-year-old former investment banker who briefly served as economy minister under the Socialist president Fran&ccedil;ois Hollande, has never run for any kind of election before. He claims his &ldquo;neither left nor right&rdquo; campaig