s 2019 national elections were widely anticipated to be the âWhatsApp electionsâ. Against a backdrop of rapidly improving internet connectivity and rising smartphone use, the number of people using private messaging service WhatsApp has soared since its India launch in mid-2010 to more than 200m â more users than in any other democracy. And now the countryâs political parties are moving to capitalise on this mass communication channel.\r\n\r\nBut given WhatsApp has already been used to misinform voters in other elections and spread damaging âfake newsâ that has led to serious violence in India, thereâs a danger this could also pose a threat to the democratic process.\r\n\r\nKeen to extend the power of social media mobilised in the 2014 election, Indiaâs ruling Bharatiya Janata Party (BJP) is trying to target smartphone-owning voters at the grass roots. More than 900,000 volunteer âcell phone pramukhsâ are creating neighbourhood-based WhatsApp groups to disseminate information about the BJPâs development achievements and prime minister Narendra Modiâs campaign activities. Meanwhile, the opposition Indian National Congress party is playing catch up with the launch of its âDigital Sathiâ app and the appointment of their own volunteers to coordinate local digital campaigns.\r\n\r\nBut thereâs good reason to think the widespread popularity of WhatsApp in India could have a damaging effect on the election. For one thing, the 2018 Brazilian elections and recent state-level elections in India exposed how WhatsApp is being used to rapidly share messages intended to misinform voters for political gain.\r\n\r\nBut India also has specific conditions related to the use of WhatsApp. While parties across Indiaâs political spectrum â as well as globally â increasingly seek to gain from fake news by manipulating public opinion, the Hindu right has been far more successful at mobilising a common socio-political identity through media like WhatsApp. In particular, invitation-only groups have spread virulent and vitriolic messages that have played a role in cultivating a strong nationalist identity.\r\n\r\nThe recent conflict with Pakistan over Kashmir, which is likely to play an influential role in the election, has led to the spread of viral content that has stoked public tension, as well as a reported flood of misinformation.\r\n\r\nUltimately, the role of WhatsApp in Indian politics needs to be understood through the interaction of technology with wider social and cultural issues. WhatsApp is a tool that amplifies certain tendencies that already exist in Indian society. For example, incidents of lynching might have much more to do with incitement to violence in a divided society than with an app that potentially facilitates the spread of rumours. Similarly, messages that promote hatred on religious, caste and gender lines rely on prevailing social cleavages.\r\n\r\nWe need a more well-rounded understanding of the emerging links between digital politics and the public sphere. How is (mis)information circulated by messaging apps related to more traditional forms of political campaigns, such as door to door canvassing, rallies and speeches? And how do these different spheres influence political participation and allegiance in different ways? This knowledge needs to be the starting point of any intervention to address WhatsAppâs role in misinformation during elections.','Indiaâs 2019 national elections were widely anticipated to be the âWhatsApp electionsâ. Against a backdrop of rapidly improving internet connectivity and rising smartphone use, the number of people using private messaging service WhatsApp has soared since its India launch in mid-2010 to more than 200m â more users than in any other democracy. And now the countryâs political parties are moving to capitalise on this mass communication channel.\r\n\r\nBut given WhatsApp has already been used to misinform voters in other elections and