--
-- Table structure for table `ic_notification`
--

DROP TABLE IF EXISTS `ic_notification`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ic_notification` (
  `notification_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `activity_id` smallint(1) unsigned NOT NULL,
  `action_id` int(1) DEFAULT NULL,
  `user_id` int(1) DEFAULT NULL,
  `receiver_id` int(1) DEFAULT NULL,
  `message_en` text COLLATE utf8_unicode_ci,
  `message_hi` text COLLATE utf8_unicode_ci,
  `state_filter` tinyint(3) unsigned DEFAULT NULL,
  `district_filter` smallint(5) unsigned DEFAULT NULL,
  `ac_filter` int(10) unsigned DEFAULT NULL,
  `group_filter` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_on` datetime NOT NULL,
  `status` enum('read','unread') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'unread',
  `read_user` text COLLATE utf8_unicode_ci,
  `type` enum('global','local') COLLATE utf8_unicode_ci DEFAULT 'local',
  PRIMARY KEY (`notification_id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

