--
-- Table structure for table `ic_user`
--

DROP TABLE IF EXISTS `ic_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ic_user` (
  `user_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `unique_id` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_fullname` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `country_code` varchar(10) COLLATE utf8_unicode_ci DEFAULT '91',
  `user_mobile` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_pin` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_gender` enum('male','female','other') COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_age` tinyint(1) unsigned DEFAULT NULL,
  `user_image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_email` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_whatsapp` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_voterid` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_state` tinyint(1) unsigned DEFAULT NULL,
  `user_district` int(10) unsigned DEFAULT NULL,
  `ac_name` int(1) unsigned DEFAULT NULL,
  `block` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `panchayat` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `region` enum('rural','urban') COLLATE utf8_unicode_ci DEFAULT NULL,
  `party_associates` enum('yes','no') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'no',
  `party_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `party_position` tinyint(11) unsigned DEFAULT NULL,
  `comment` text COLLATE utf8_unicode_ci,
  `yip_advocates` enum('yes','no') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'no',
  `yip_hosts` enum('yes','no') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'no',
  `yip_fellow` enum('yes','no') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'no',
  `yip_ambassador` enum('yes','no') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'no',
  `user_device_type` enum('ios','android') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'ios',
  `user_device_token` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `user_status` enum('active','inactive') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'active',
  `user_delete_status` enum('1','0') COLLATE utf8_unicode_ci DEFAULT '1' COMMENT '0->Deleted, 1->Not Deleted',
  `profile_completed` enum('true','false') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'false',
  `referal_id` int(11) unsigned DEFAULT NULL,
  `created_on` datetime NOT NULL,
  `updated_on` datetime DEFAULT NULL,
  `user_ip` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_lang` enum('en','hi') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'en',
  `push_notification` enum('on','off') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'on',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `unique_id` (`unique_id`),
  UNIQUE KEY `user_mobile` (`user_mobile`),
  KEY `user_fullname` (`user_fullname`)
) ENGINE=InnoDB AUTO_INCREMENT=256 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='User Table';
